import { Component, Input, OnInit } from '@angular/core';
import { MatDialog} from '@angular/material/dialog';
import { PostStatusEnum } from 'src/app/shared/enums/PostStatusEnum';
import { EnumService } from 'src/app/shared/services/enum.service';
import { PostContactDialog } from './post-contact-dialog/post-contact-dialog.component';


@Component({
  selector: 'app-post-detail',
  templateUrl: './post-detail.component.html',
  styleUrls: ['./post-detail.component.css']
})
export class PostDetailComponent implements OnInit {
  @Input() post: any; // just temprora, change the type back to Post

  public conditionDict = {};
  constructor(public enumService: EnumService, public dialog: MatDialog) { }

  /**
   * Handle click "Reply"
   * 1. Implement Capcha
   * 2. Open the Dialog
   */
  onOpenDialog(){
    // implement capcha

    // open the dialog
    const dialogRef = this.dialog.open(PostContactDialog, {
      data: {
        email: this.post.PostContactEmail,
        phone: this.post.PostContactPhone
      }
    });

  }

  ngOnInit(): void {
    // get the condition Dictionary
    const conditions = this.enumService.getConditionDict()
    for (let key of Object.keys(conditions)){
      const value = conditions[key];
      this.conditionDict[value] = key;
    }

    if (!this.post){
    this.post = {
      "PostTitle": "I want to giveaway my old phone",
      "PostLocation": "301 A, North Pacific",
      "PostCondition": 1,
      "PostDescription": "iPhone 7 Plus in pristine condition. Can be used with any carrier. All original Apple parts. Never been opened or fixed. Includes warranty and charger. ",
      "PostTag": 0,
      "PostPictures": [
        "data:image/jpeg;base64,",
        "data:image/jpeg;base64,",
        "data:image/jpeg;base64,"
      ],
      "PostContactEmail": "tnguyen7s@semo.edu",
      "PostContactPhone": "5732001417",
      "PostId": -1,
      "PostStatus": PostStatusEnum.Active
    }
    }

  }
}


